webpackJsonp([0xd2973cb7b5bc],{6943:function(e,t){e.exports={data:{post:{html:'<p>blogg.de is a German combination of Blogspot and Technorati... it\'s a floor wax <em>and</em> a desert topping!* Er, I mean it\'s a hoster <em>and</em> an aggregator. And like Technorati, it\'s been having it\'s problems lately. Nico mentions his current  <a href="http://lumma.de/eintrag.php?id=467" title="mysqlsnapshot [Lummaland]">love/hate relationship with MySQL</a> and the Zawondny tool <a href="http://jeremy.zawodny.com/mysql/mysqlsnapshot/">mysqlsnapshot</a>. I hope he\'s reading the <a href="http://www.amazon.com/exec/obidos/ASIN/0596003064" title="High Performance MySQL">Zawodny book</a> as well. I found it helpful when rearranging IPs for my absolutely-has-to-be-up bugtracker database. Generally, I\'ve found that problems I seem to be having with MySQL can either be tuned away or are actually with the operating system. So don\'t lose hope!</p>\n<p>(*For my German readers, this is an <a href="http://www.google.com/search?q=saturday+night+live+floor+wax+dessert+topping">SNL reference,</a> so you won\'t get it.)</p>',fields:{title:"Blogg Topping",date:"03 Aug 2004",url:"https://papascott.de/2004-08-03-blogg-topping/"}}},pathContext:{slug:"/2004-08-03-blogg-topping/",prev:{fields:{title:"Black Thursday",date:"03 Aug 2004",slug:"/2004-08-03-black-thursday/"}},next:{fields:{title:"Concorde",date:"03 Aug 2004",slug:"/2004-08-03-concorde/"}}}}}});
